    true,nt"url": null,nt"notes": "The zip file linked contains three subdirectories
    and a parameter list to be used for processing using ACCEPT. Datafiles are partitioned
    into training, validation, and testing sub-directory structures. A text file contains
    all parameter identifiers associated with the cold complaint prediction scenario.
    Please note that the parameter list is a text file containing the following lines:rnrnDC114T
    - Electrical room temperaturernDCRCS103 - Carbon Dioxide concentration sensor in
    first floor conference roomrnDCTN240T - Second floor conference room temperaturernrnPlease
    note that Appendix E of an accompanying technical report will be posted here shortly,
    which will provide more detail on the cold complaint scenario, along with step-by-step
    directions on how to reproduce the results for this example using ACCEPT. Other
    appendices will provide detailed set up and configuration instructions.rnrnHere
    is the citation:rnrnRodney Martin, Santanu Das, Vijay Janakiraman, Stefan Hosein.
    ACCEPT: Introduction of the Adverse Condition and Critical Event Prediction Toolbox,
    NASA Technical Report, NASA/TMu20132015u2013 218927, November 2015.rn",nt"license_title":
